import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const AdminProductList = () => {
  const [products, setProducts] = useState([]);
  const [newProduct, setNewProduct] = useState({
    name: '',
    description: '',
    full_description: '',
    price: ''
  });

  const navigate = useNavigate();
  const API_URL = process.env.REACT_APP_API_URL;
  const token = localStorage.getItem('adminAccessToken');

  const fetchProducts = () => {
    axios.get(`${API_URL}/products`)
      .then(res => setProducts(res.data))
      .catch(() => alert('Ошибка при загрузке продуктов'));
  };

  useEffect(() => {
    fetchProducts();
  }, []);

  const handleAddProduct = (e) => {
    e.preventDefault();
    axios.post(`${API_URL}/products`, newProduct, {
      headers: { Authorization: token }
    })
    .then(() => {
      alert('Продукт успешно добавлен');
      setNewProduct({ name: '', description: '', full_description: '', price: '' });
      fetchProducts();
    })
    .catch(err => {
      alert(err.response?.data?.detail || 'Ошибка при добавлении');
    });
  };

  const handleDelete = (id) => {
    if (!window.confirm('Удалить продукт?')) return;
    axios.delete(`${API_URL}/products`, {
      headers: { Authorization: token },
      params: { prod_id: id }
    })
    .then(() => {
      alert('Удалено');
      fetchProducts();
    })
    .catch(() => alert('Ошибка при удалении'));
  };

  return (
    <div>
        {/* Hero Section */}
      <section className="hero" id="hero">
        <div className="hero-content">
          <h1>Защита банковских данных</h1>
          <p>Передовые решения для кибербезопасности в банковской сфере</p>
        </div>
      </section>
      <h2>Список продуктов</h2>

      <form onSubmit={handleAddProduct} className="admin-form">
        <input
          type="text"
          placeholder="Название"
          value={newProduct.name}
          onChange={e => setNewProduct({ ...newProduct, name: e.target.value })}
          required
        />
        <input
          type="text"
          placeholder="Описание"
          value={newProduct.description}
          onChange={e => setNewProduct({ ...newProduct, description: e.target.value })}
          required
        />
        <textarea
          placeholder="Полное описание"
          value={newProduct.full_description}
          onChange={e => setNewProduct({ ...newProduct, full_description: e.target.value })}
          required
        />
        <input
          type="number"
          placeholder="Цена"
          value={newProduct.price}
          onChange={e => setNewProduct({ ...newProduct, price: e.target.value })}
          required
        />
        <button type="submit">Добавить</button>
      </form>

      <ul className="product-list">
        {products.map(product => (
          <li key={product.id} className="product-item">
            <strong>{product.name}</strong> — {product.price}₽
            <div>
              <button onClick={() => navigate(`/admin/products/${product.id}`)}>Редактировать</button>
              <button onClick={() => handleDelete(product.id)}>Удалить</button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AdminProductList;
